import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awStepProgressRenderFunction } from 'js/AwStepProgressService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwStepProgressService', () => import('js/AwStepProgressService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awStepProgressRenderFunction",
            "deps": "js/AwStepProgressService",
            "options": {
                "useAria": true
            }
        }
    },
    "props": {
        "current-step": {
            "type": "object"
        },
        "completed-step": {
            "type": "object"
        },
        "steps": {
            "type": "object"
        },
        "clickable": {
            "type": "object"
        },
        "step-click-action": {
            "type": "action"
        }
    },
    "data": {
        "isStepLinkClicked": false
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "i18n": {
        "COMPLETED": [
            "UIElementsMessages"
        ],
        "CURRENT": [
            "UIElementsMessages"
        ]
    },
    "_viewModelId": "AwStepProgress",
    "_uniqueViewModelId": "AwStepProgress",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awStepProgressRenderFunction, {"useAria":true}, ctxImportObj );

export default Component;
